import React from "react";
import styled from "styled-components";

const Modal = styled.div`
  width: 100vw;
  height: 100vh;
  background: rgba(0, 0, 0, 0.3);
  position: relative;
  left: 0;
  top: 0;
  z-index: 1000;
`;

const ModalRender = props => {
  return <Modal />;
};

export default ModalRender;
